import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

//importar nuestros componentes
import ShowProduct from './components/showProduct';

function App() {
    return (
      <div className="app">
        <Router>
            <Routes>
              <route path='/' element={<ShowProduct />} />

            </Routes>
        </Router>
      </div>
    );
}

export default App;
